import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import store from "./stores/store";
import {Provider} from "react-redux"
import './styles/styles.scss'

ReactDOM.render(
    <Provider store={store}>
        <App />
    </Provider>
    , document.getElementById('root'));
